import React from 'react';

// material-ui
import { Typography, Grid, List, ListItem, Card, Button } from '@material-ui/core';
import { Tree, TreeNode } from 'react-organizational-chart';
import { gridSpacing } from '../../store/constant'

// project imports
import MainCard from 'ui-component/cards/MainCard';


import OrgChartData from 'SampleData';


// ==============================|| SAMPLE PAGE ||============================== //

const Orgchart = () => {
    const renderTree = (OrgChartData) => {
        return (
            <Tree label={<div><h1>20 AMXS</h1><h2>BAFB</h2></div>}>
                            <TreeNode label={<div>Production</div>}>
                                <TreeNode label={<div>JETS</div>} />
                                <TreeNode label={<div>JETS</div>} />
                                <TreeNode label={<div>JETS</div>} />
                            </TreeNode>
                        </Tree>
        )
    }
    return (
    <>
        <Grid container spacing={gridSpacing}>


            <Grid item xs={12}>
                <Grid container spacing={gridSpacing}>
                    <Grid item xs={12} md={8}>
                    <Card>
                        {renderTree(OrgChartData)}
                    </Card>
                    </Grid>
                    <Grid item xs={12} md={4}>
                    <Card>
                        <List>
                            <ListItem>123</ListItem>
                            <ListItem>123</ListItem>
                            <ListItem>123</ListItem>
                            <ListItem>123</ListItem>
                            <ListItem>123</ListItem>
                        </List>

                    </Card>
                    </Grid>
                </Grid>
            </Grid>
        </Grid>
    </>
)};

export default Orgchart;
